import './App.css';
import { BrowserRouter, Routes } from 'react-router-dom'
import HeaderBar from './components/HeaderBar'
import Dashboard from './components/Dashboard';

function App() {
  return (
    <div id="app">
      <HeaderBar />
      <BrowserRouter>
        <Route path="/" element={<Dashboard />} />
        <Routes path="/blanko" element={<Dashboard />} />
        <Routes path="/slido" element={<Dashboard />} />
        <Routes path="/tetro" element={<Dashboard />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
